import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ListPlanComponent from './components/AdminComponents/ListPlanComponent';
import HeaderComponent from './components/AdminComponents/HeaderComponent';
import FooterComponent from './components/AdminComponents/FooterComponent';
import CreatePlanComponent from './components/AdminComponents/CreatePlanComponent';
import ViewPlanComponent from './components/AdminComponents/ViewPlanComponent';
import UserLogin from './components/AuthComponents/UserLogin';
import UserRegistrationComponent from './components/AuthComponents/UserRegistrationComponent';

function App() {
  return (
    <div className="App">
      <Router>
        {/* <div className='container'> */}

          <HeaderComponent />
          <div className="container">
            <Routes >
            <Route path="/" element={<ListPlanComponent />} />
            <Route path="/travelplans" element={<ListPlanComponent />} />
            <Route path="/add-plan/:id" element={<CreatePlanComponent />} />
            {/* <Route path="/view-plan/:id" element={<ViewPlanComponent />} /> */}
            <Route path="/login" element={<UserLogin />} />
            <Route path="/register" element={<UserRegistrationComponent />} />
            <Route path="/users" element={<UserRegistrationComponent />} />
<div></div>

            </Routes>
          {/* </div> */}
          <FooterComponent />
        </div>
      </Router>
    </div>
  );
}

export default App;
